Movie Info: Zanjeer ('Shackles'; titled Thoofan in Telugu) is a 2013 Indian action film directed by Apoorva Lakhia, shot simultaneously in Hindi and Telugu. It is a remake of the 1973 Hindi film of the same name. The film marked the Bollywood debut of Tollywood actor Ram Charan in the lead role along with Priyanka Chopra.

